import React, { useState } from "react";
import "./Navbar.css";

const Navbar = () => {
  const [isOpen, setIsOpen] = useState(false);

  const handlerToggle = () => {
    setIsOpen(!isOpen);
  };

  return (
    <header>
      <div className="navbar">
        <button onClick={handlerToggle}>
          {isOpen ? (
            <i className="btn-menu" class="fa-solid fa-bars fa-xl"></i>
          ) : null}
        </button>

        <div className="logo">
          <img
            src="https://www.wpkube.com/wp-content/themes/wpkube4/images/logo.png"
            width="130"
            height="49"
            alt="logo"
          />
        </div>
        <ul className="nav-list">
          <li>
            <a href="#">CATEGORIES</a>
          </li>
          <li>
            <a href="#">GUIDES</a>
          </li>
          <li>
            <a href="#">WORDPRESS HOSTING</a>
          </li>
          <li>
            <a href="#">MANAGED HOSTING</a>
          </li>
          <li>
            <a href="#">COUPONS</a>
          </li>
        </ul>
        <div className="nan-icon">
          <i className="fa-brands fa-facebook-f fa-lg"></i>
          <i className="fa-brands fa-twitter fa-lg"></i>
        </div>
      </div>
    </header>
  );
};

export default Navbar;
